pub enum StdError {
    GenericErr {
        msg: String,
        backtrace: Option<snafu::Backtrace>,
    },
    InvalidBase64 {
        msg: String,
        backtrace: Option<snafu::Backtrace>,
    },
    InvalidUtf8 {
        msg: String,
        backtrace: Option<snafu::Backtrace>,
    },
    NotFound {
        kind: String,
        backtrace: Option<snafu::Backtrace>,
    },
    ParseErr {
        target: String,
        msg: String,
        backtrace: Option<snafu::Backtrace>,
    },
    SerializeErr {
        source: String,
        msg: String,
        backtrace: Option<snafu::Backtrace>,
    },
    Unauthorized {
        backtrace: Option<snafu::Backtrace>,
    },
    Underflow {
        minuend: String,
        subtrahend: String,
        backtrace: Option<snafu::Backtrace>,
    },
}

pub enum SystemError {
    InvalidRequest {
        error: String,
        request: Binary,
    },
    InvalidResponse {
        error: String,
        response: Binary,
    },
    NoSuchContract {
        addr: HumanAddr,
    },
    Unknown {
    },
    UnsupportedRequest {
        kind: String,
    },
    ExceededRecursionLimit {
    },
}

pub enum GovMsg {
    Vote {
        proposal: u64,
        vote_option: VoteOption,
    },
}

pub enum BankMsg {
    Send {
        from_address: HumanAddr,
        to_address: HumanAddr,
        amount: Vec<Coin>,
    },
}

pub enum StakingMsg {
    Delegate {
        validator: HumanAddr,
        amount: Coin,
    },
    Undelegate {
        validator: HumanAddr,
        amount: Coin,
    },
    Withdraw {
        validator: HumanAddr,
        recipient: Option<HumanAddr>,
    },
    Redelegate {
        src_validator: HumanAddr,
        dst_validator: HumanAddr,
        amount: Coin,
    },
}

pub enum WasmMsg {
    Execute {
        contract_addr: HumanAddr,
        callback_code_hash: String,
        msg: Binary,
        send: Vec<Coin>,
    },
    Instantiate {
        code_id: u64,
        callback_code_hash: String,
        msg: Binary,
        send: Vec<Coin>,
        label: String,
    },
}

pub enum BankQuery {
    Balance {
        address: HumanAddr,
        denom: String,
    },
    AllBalances {
        address: HumanAddr,
    },
}

pub enum DistQuery {
    Rewards {
        delegator: HumanAddr,
    },
}

pub enum WasmQuery {
    Smart {
        contract_addr: HumanAddr,
        callback_code_hash: String,
        msg: Binary,
    },
    Raw {
        contract_addr: HumanAddr,
        key: Binary,
        callback_code_hash: String,
    },
}

pub enum StakingQuery {
    BondedDenom {
    },
    AllDelegations {
        delegator: HumanAddr,
    },
    Delegation {
        delegator: HumanAddr,
        validator: HumanAddr,
    },
    Validators {
    },
    UnbondingDelegations {
        delegator: HumanAddr,
    },
}
